import ReactDOM from 'react-dom';
//import './index.css';
import {BrowserRouter as Router} from "react-router-dom"
import App from './App';
import * as serviceWorker from './serviceWorker';
import {RoomProvider} from './Context'
ReactDOM.render(
  <Router>
    <App />
  </Router>,


  document.getElementById('root')
);

